    {
        enumType = null!;
        return ByTypeName.TryGetValue(typeName, out var info) && (enumType = info.EnumType) != null;
    }

    internal static bool TryGetEnumInfo(Type enumType, out EnumInfo info)
    {
        foreach (var kvp in ByTypeName)
        {
            if (kvp.Value.EnumType == enumType)
            {
                info = kvp.Value;
                return true;
            }
        }
        info = null!;
        return false;
    }
